  return (
    <div>
      <h1>โปรแกรมบัญชีรายรับ - รายจ่าย</h1>
      <p>บันทึกข้อมูลบัญชีในแต่ละวัน</p>
      <ul>
        <li>ค่าเดินทาง <span>- 200</span></li>
        <li>เงินเดือน <span>+ 20,000</span></li>
        <li>ค่าอาหาร <span>- 500</span></li>
      </ul>
    </div>
  );
}

